import React from "react";
import photo from "../../assets/Dinner-N-Movie.png";

function Portfolio() {
  const currentCategory = {
    name: "Dinner-N-Movie",
    description: "The app that answers, 'What's for dinner?",
  };
  return (
    <section>
      <h1>{currentCategory.name}</h1>
      <p>{currentCategory.description}</p>
      <div className="flex-row">
        <im src={photo} alt="Dinner-N-Movie" className="img-thumbnail mx-1" />
      </div>
    </section>
  );
}

export default Portfolio;
